import styled from "styled-components";

const Wrapper = styled.div`
    display: flex;
    justify-content: center;
    height: 100vh;
    align-items: center;
`;
const Title = styled.h1`
    font-size: 40px;
    font-weight: 800;
    margin-bottom: 20px;
    color:#e37676;
`
const P = styled.p`
    margin-bottom: 10px;
`
const Form = styled.form`
    flex-direction: column;
    width: 500px;
    justify-content: center;
    align-items: center;
    display: flex;
`;
const Input = styled.input`
    width: 400px;
    padding: 10px;
    margin: 10px;
    border: none;
    border-radius: 5px;
    font-size: 17px;
    &[type="submit"]{
        width: 420px;
        font-weight: 600;
        background-color: #e37676;
        color: white;
    }
`;


export default function Login(){

    return(
        <Wrapper>
            <Form>
                <Title>UNTITY 2</Title>
                <P>레전드 일베충들의 두번째 시즌</P>
                <Input type="text" placeholder="ID"/>
                <Input type="password" placeholder="PW"/>
                <Input type="submit" value="LOGIN"/>
            </Form>
        </Wrapper>
    );
}
